import React, { Component } from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import Admin from "./components/Layout/Admin/Admin";

export default class App extends Component {

  render() {
    return (

      <BrowserRouter>
      <div> 
        <Switch>
        <Route exact path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>

    );
  }
}

function Home() {
  return (
    <div>
      <Admin/>
    </div>
  );
}
